import React from 'react';
import Skills from "./Skills";
import NavigationBar from "./NavigationBar";
import Footer from "./Footer";

import './style/App.css';

class SkillPage extends React.Component {
    render() {
        return (
          <div className="">
              <NavigationBar/>
              <Skills/>
              <Footer/>
          </div>
        );
    }
}

export default SkillPage;
